// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";

import "hardhat/console.sol";

contract NFTMarketplace is ERC721URIStorage {
    using Counters for Counters.Counter;
    Counters.Counter private _tokenIds;
    Counters.Counter private _itemsSold;

    uint256 listingPrice = 0.000001 ether;
    address payable owner;

    mapping(uint256 => MarketItem) private idToMarketItem;

    struct MarketItem {
        uint256 tokenId;
        address payable seller;
        address payable owner;
        uint256 price;
        bool sold;
        bytes32 hash; // Nuevo campo para almacenar el hash de autenticidad
    }

    event MarketItemCreated(
        uint256 indexed tokenId,
        address seller,
        address owner,
        uint256 price,
        bool sold,
        bytes32 hash // Nuevo campo para registrar el hash de autenticidad en el evento
    );

    modifier onlyOwner() {
        require(
            msg.sender == owner,
            "only owner of the marketplace can change the listing price"
        );
        _;
    }

    constructor() ERC721("Metaverse Tokens", "METT") {
        owner = payable(msg.sender);
    }

    /* Updates the listing price of the contract */
    function updateListingPrice(uint256 _listingPrice)
        public
        payable
        onlyOwner
    {
        require(
            owner == msg.sender,
            "Only marketplace owner can update listing price."
        );
        listingPrice = _listingPrice;
    }

    /* Returns the listing price of the contract */
    function getListingPrice() public view returns (uint256) {
        return listingPrice;
    }

    // Crear token de activo digital
    function createToken(string memory tokenURI, uint256 price, bytes32 hash)
        public
        payable
        returns (uint256)
    {
        require(!isHashRegistered(hash), unicode"Este hash ya est registrado para otro activo digital.");

        _tokenIds.increment();
        uint256 newTokenId = _tokenIds.current();

        _mint(msg.sender, newTokenId);
        _setTokenURI(newTokenId, tokenURI);
        createMarketItem(newTokenId, price, hash); // Llamamos `createMarketItem` con el hash
        _itemsSold.increment();
        return newTokenId;
    }

    // Crear activo digital
    function createMarketItem(uint256 tokenId, uint256 price, bytes32 hash) private {
        require(price > 0, "Price must be at least 1 wei");
        require(
            msg.value == listingPrice,
            "Price must be equal to listing price"
        );

        idToMarketItem[tokenId] = MarketItem(
            tokenId,
            payable(address(0)),
            payable(msg.sender),
            price,
            false,
            hash // Almacenamos el hash en el struct
        );

        // _transfer(msg.sender, address(this), tokenId);
        emit MarketItemCreated(
            tokenId,
            payable(address(0)),
            payable(msg.sender),
            price,
            true,
            hash // Emitimos el evento con el hash
        );
    }

    // Nueva funcin para verificar si un hash ya est registrado
    function isHashRegistered(bytes32 hash) public view returns (bool) {
        uint256 totalItemCount = _tokenIds.current();
        for (uint256 i = 0; i < totalItemCount; i++) {
            if (idToMarketItem[i + 1].hash == hash) {
                return true; // Hash ya registrado
            }
        }
        return false; // Hash no encontrado
    }

    // Listar activo digital en el mercado
    function resellToken(uint256 tokenId, uint256 price) public payable {
        require(
            idToMarketItem[tokenId].owner == msg.sender,
            "Only item owner can perform this operation"
        );
        require(
            msg.value == listingPrice,
            "Price must be equal to listing price"
        );
        idToMarketItem[tokenId].sold = false;
        idToMarketItem[tokenId].price = price;
        idToMarketItem[tokenId].seller = payable(msg.sender);
        idToMarketItem[tokenId].owner = payable(address(this));
        _itemsSold.decrement();

        _transfer(msg.sender, address(this), tokenId);
    }

    // Eliminar activo digital del mercado
    function cancelSale(uint256 tokenId) public {
        MarketItem storage item = idToMarketItem[tokenId];
        require(item.seller == msg.sender, "Only the seller can cancel the sell");
        require(!item.sold, "Item has already been sold");

        item.owner = item.seller;
        item.sold = true;
        item.seller = payable(address(0));
        _itemsSold.increment();

        _transfer(address(this), msg.sender, tokenId);
    }

    // Comprar activo digital del mercado
    function createMarketSale(uint256 tokenId) public payable {
        uint256 price = idToMarketItem[tokenId].price;
        require(
            msg.value == price,
            "Please submit the asking price in order to complete the purchase"
        );
        idToMarketItem[tokenId].owner = payable(msg.sender);
        idToMarketItem[tokenId].sold = true;
        _itemsSold.increment();
        _transfer(address(this), msg.sender, tokenId);
        payable(owner).transfer(listingPrice);
        payable(idToMarketItem[tokenId].seller).transfer(msg.value);
        idToMarketItem[tokenId].seller = payable(address(0));
    }

    // Transferir activo digital a otro usuario
    function donateToken(uint256 tokenId, address recipient) public {
        require(idToMarketItem[tokenId].owner == msg.sender, "Only the token owner can donate it");
        require(recipient != address(0), "Recipient address cannot be zero address");

        idToMarketItem[tokenId].owner = payable(recipient);
        idToMarketItem[tokenId].seller = payable(address(0));
        idToMarketItem[tokenId].sold = true;

        _transfer(msg.sender, recipient, tokenId);
    }

    // Devolver la lista de activos digitales a la venta en el mercado
    function fetchMarketItems() public view returns (MarketItem[] memory) {
        uint256 itemCount = _tokenIds.current();
        uint256 unsoldItemCount = _tokenIds.current() - _itemsSold.current();
        uint256 currentIndex = 0;

        MarketItem[] memory items = new MarketItem[](unsoldItemCount);
        for (uint256 i = 0; i < itemCount; i++) {
            if (idToMarketItem[i + 1].owner == address(this)) {
                uint256 currentId = i + 1;
                MarketItem storage currentItem = idToMarketItem[currentId];
                items[currentIndex] = currentItem;
                currentIndex += 1;
            }
        }
        return items;
    }

    // Devolver la lista de activos digitales del usuario
    function fetchMyNFTs() public view returns (MarketItem[] memory) {
        uint256 totalItemCount = _tokenIds.current();
        uint256 itemCount = 0;
        uint256 currentIndex = 0;

        for (uint256 i = 0; i < totalItemCount; i++) {
            if (idToMarketItem[i + 1].owner == msg.sender) {
                itemCount += 1;
            }
        }

        MarketItem[] memory items = new MarketItem[](itemCount);
        for (uint256 i = 0; i < totalItemCount; i++) {
            if (idToMarketItem[i + 1].owner == msg.sender) {
                uint256 currentId = i + 1;
                MarketItem storage currentItem = idToMarketItem[currentId];
                items[currentIndex] = currentItem;
                currentIndex += 1;
            }
        }
        return items;
    }

    // Devolver la lista de activos digitales del usuario a la venta
    function fetchItemsListed() public view returns (MarketItem[] memory) {
        uint256 totalItemCount = _tokenIds.current();
        uint256 itemCount = 0;
        uint256 currentIndex = 0;

        for (uint256 i = 0; i < totalItemCount; i++) {
            if (idToMarketItem[i + 1].seller == msg.sender) {
                itemCount += 1;
            }
        }

        MarketItem[] memory items = new MarketItem[](itemCount);
        for (uint256 i = 0; i < totalItemCount; i++) {
            if (idToMarketItem[i + 1].seller == msg.sender) {
                uint256 currentId = i + 1;
                MarketItem storage currentItem = idToMarketItem[currentId];
                items[currentIndex] = currentItem;
                currentIndex += 1;
            }
        }
        return items;
    }

    // Aadir esta funcin en tu contrato NFTMarketplace
    function getMarketItem(uint256 tokenId) public view returns (MarketItem memory) {
        return idToMarketItem[tokenId];
    }

    // 1. Obtener todos los activos digitales registrados
    function getAllDigitalAssets() public view returns (MarketItem[] memory) {
        uint256 totalItemCount = _tokenIds.current();
        MarketItem[] memory items = new MarketItem[](totalItemCount);

        for (uint256 i = 0; i < totalItemCount; i++) {
            uint256 currentId = i + 1;
            MarketItem storage currentItem = idToMarketItem[currentId];
            items[i] = currentItem;
        }
        return items;
    }

    // 2. Obtener el valor del contador de IDs de tokens
    function getTokenIdCounter() public view returns (uint256) {
        return _tokenIds.current();
    }

    // 3. Obtener el valor del contador de tems vendidos
    function getItemsSoldCounter() public view returns (uint256) {
        return _itemsSold.current();
    }

    function getCertificateHash(uint256 tokenId) public view returns (bytes32) {
        return idToMarketItem[tokenId].hash;
    }

}
